/**
 *
 * @interface IVector2
 * @param {Number} [x=0] X position.
 * @param {Number} [y=0] Y position.
 * @constructor
 **/
export interface IVector2 {
    /**
     * X position.
     * @property x
     * @type Number
     **/
    x: number;
    /**
     * Y position.
     * @property y
     * @type Number
     **/
    y: number;
}
